import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
    const [linhasOnibus, setLinhasOnibus] = useState([]);

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/linhas-onibus')
            .then(response => {
                setLinhasOnibus(response.data.linhas);
            })
            .catch(error => {
                console.error('Erro ao buscar as linhas de ônibus:', error);
            });
    }, []);

    return (
        <div>
            <select>
                {linhasOnibus.map((linha, index) => (
                    <option key={index}>{linha}</option>
                ))}
            </select>
        </div>
    );
}

export default App;
